import 'package:ieca_mobile/enums/hymns_content_code.dart';
import 'package:ieca_mobile/models/_import.dart';
import 'package:ieca_mobile/seeders/fiote/_import.dart';

class FtHymnsGeneral {
  static List<HymnsContent> list = [
    HymnsContent(id: 4500, position: 1, content: "Tuzitisa nge\nBu wavana Yesu\nWatufwila masumu,\nWafuluka mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4501, content: "Haleluya! Tukutonda\nTukuzitisanga.\nHaleluya! Tukutonda\nDo, vumusanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4502, position: 2, content: "Ye Meme dio mpe,\nDiatufwila mambi\nYe wavedisa ntima\nMia bantu nave.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4503, position: 3, content: "Tuzitisa Nge\nBu wavana Mpeve,\nYatukienzula tombe\nYe tiemusa mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4504, position: 4, content: "Tutondanga Nge\nU nkwa nlemvo wawo,\nWeti sungika beto\nMu nzil´a Dise.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4505, position: 5, content: "Do! Vumusanga,\nUtuwesa zola;\nUtulemisa mbazu\nMu ntima mieto.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_1, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4506, position: 1, content: "Nlongo! Nlongo! Nlongo!\nNzambi ya Tulendo,\nTuna yimbidila ngeye\nNkung’anzitusu;\nNgeye si wakwiza, wena ye\nwakala,\nTata ye Mwana ye Mpeve\nYangongo!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4507, position: 2, content: "Nlongo! Nlongo! Nlongo!\nNkangu mia kizulu\nMieti zitisanga nkumbu aku\nmvu yamvu.\nNgeye watufwila, Ngeye bu\nwanunga,\nTambula lendo ye nzitusu\nbiabio!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4508, position: 3, content: "Nlongo! Nlongo! Nlongo!\nNtinu a mintinu,\nZulu, ntoto ye mimbu\nbizitisanga Nge!\nNlongo! Nlongo! Nlongo\nZambi ya tulendo\nTata ye Mwana ye Mpeve\nYangolngo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_2, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4509, position: 1, content: "Yesu, Ngeye utuvunga,\nKadi Ngeye Mvungudi,\nMu kuwila i mu vunda,\nNgeye mpe i Mvundisi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4510, content: "Tukulanda, tukulanda.\nToma kutulonganga,\nTukulanda, tukulanda,\nToma kutulonganga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4511, position: 2, content: "Mu nzil’aku utunata,\nUtutuamina ku ntu;\nMauzola utusonga,\nTuna sisa bieto fu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4512, position: 3, content: "Beto tu mameme maku,\nNzila yituavengama,\nNgeye kala Mvungi eto,\nNgeye utusungika.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4513, position: 4, content: "Ngeye Yesu watutomba,\nNgeye watuvulusa,\nVuvu teuna mpe mu Ngeye,\nNgeye si wayala nza.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_3, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4514, position: 1, content: "Bika tuayimbila:\nAleluya amen!\nKunda ye zitisa,\nAleluya amen!\nKintuadi tuna sa\nMu kunda Yehova\nNzambi wazangama\nAleluya amen!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4515, position: 2, content: "Nzambi uyalanga.\nAleluya amen!\nYenge kavananga.\nAleluya amen!\nLuyalungunu bwe?\nUntoto, keti bwe!\nNsi ye kayengele!\nAleluya amen!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4516, position: 3, content: "Nkembo kwa Nzambi se!\nAleluya amen!\nKwa Mpeve nkembo npe!\nAleluya amen!\nYesu i Mvulusi\nWayiza fwa va nti,\nWabedisa mambi.\nAleluya amen!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4517, position: 4, content: "Nzambi tukembela:\nAleluya amen!\nYesu tuzitisa:\nAleluya amen!\nMfumu yanzitusi\nMvulusi mvu ya mvu.\nSe, mwana, Mpeve mpe.\nAleluya amen!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_4, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4518, position: 1, content: "Yadisa Ntinu wo\nMu koko kwa Dise;\nKu zulu nkung’anzitusu\nKwa Yesu tuna wa.\nMwel’ami sikama,\nMu Yesu yimbila\nWafwila beto, Ntinu wo,\nLunyandisa babo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4519, position: 2, content: "Yadisa Ntinu wo,\nKiazolwa kia Dise,\nMu moko mandi fu biena,\nTutoma zitisa.\nKa mpofi mosi ko\nYilembwa yinama;\nBafukanga bizizi biau,\nBankembilanga mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4520, position: 3, content: "Yadisa Ntinu wo\nWamoyo mvu ya mvu,\nWafuluka ye zituswa\nMu kututanina.\nWafwa ye fuluka,\nSi tuakunzitisa;\nWavana beto moyo mpe,\nLufwa kabedisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4521, position: 4, content: "Yadisa Ntinu wo,\nWazulu, ye Dise,\nWavana Mpeve kwa babo,\nWatambulwa kwa Se.\nSi tuakunkembela\nMu mvu miamionsono;\nMu zola watuzalanga;\nTutoma sambila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_5, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4522, position: 1, content: "Kiese ngieti mona bwabu\nDiatanga ye Mvulusi,\nDiatanga mu tambi biandi\nKonso kukadiatanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4523, content: "Diatanga, diatanga,\nDiatanga ye Yesu,\nLumbu ki, mwamonso,\nDiatanga ye Yesu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4524, position: 2, content: "Diatanga ye Mfumu Yesu,\nYekamanga Yandi mpe,\nKonso kukatuaminanga,\nKuna ngina namanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4525, position: 3, content: "Diatanga ye Yesu Klisto,\nLokula ka lokula;\nMiongo miena nda mu maka\nYe tulenda maka mio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4526, position: 4, content: "Yesu utufinamanga\nLumbu ki ye mvu ka mvu;\nDiatanga mu tambi biaku,\nDiatanga ye Nge’ mwamo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_6, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4527, position: 1, content: "Luzitisa Yesu Klisto\nDimeme dia Zambi.\nYandi i Mvulusi eto,\nLunsika, Mfumu anza!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4528, position: 2, content: "Zinsi zazo, bantu babo,\nLusadila Yesu.\nLumvana ntima mieno,\nLunsika, Mfumu anza!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4529, position: 3, content: "Lunzitisa, lunzitisa,\nBeno luavuluswa,\nMfumu eno, lunyandisa,\nLunsika, Mfumu anza!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4530, position: 4, content: "Mu zulu ntindi kadila\nYe bau bafonguswa\nYe sadila ye zitisa\nYesu, i Mfumu anza!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_7, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4531, position: 1, content: "Nani obanza o fuku dina vo\nnene wabutuka?\nNtemo ampwena se watema:\nOwu uzal´e nza\nMbasi z’e zulu kembela dio,\nNzambi o Se betondanga\nMwan’a Nzambi, Mwan’ a\nmuntu.\nWau kabutuka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4532, content: "Wiza, wiza nza kungwisa,\nNsamu wau uzenzanga\nO Mesi’o Ntinu a nkembo.\nWau kabutuka", hymnsNumber: FtHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4533, position: 2, content: "Kiese kingi ayiz’atwasi\nE nza se yiyanzanga\nYesu i Ntwadisi a Walakazi\nSe tuyambana,\nNyazi a nsongi, Nkambami\nmpe\nBika wau twankembela;\nMfumu Yesu Mpungu-wete\nWau kabutuka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4534, position: 3, content: "An’ayiva y’an’avezwa\nYesu yau kekokanga,\nSula-mabi, kondwa-nkenda,\nYau basikila.\nO ungudi uwokalanga,\nVana nzo se zolana\nMvangi a ngemba, mpungunkaka\nWau kabutuka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4535, position: 4, content: "Bika nsangu yend’a\nmwangwa\nMfumu Yesu wayal’e nza\nAkwa ntantu se baseva,\nYesu i Konka-nsa.\nO luvevuku mpe katwasa,\nZavo Yandi otondwanga,\nO Mesia Mpungu-zola\nWau kabutuka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_8, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4536, position: 1, content: "Ntangu bu yadimuka,\nBantu mpe balekanga.\nMbasi zau zamonika,\nNkunga wau bayimbila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4537, content: "Glo…………………ria\nIn excelsis Deo\nGlo…………………ria\nIn excelsis De………..o", hymnsNumber: FtHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4538, position: 2, content: "Nsamu ubasamuna\nMbutulu a Mvulusi.\nNzambi si kakembuswa,\nBantu yangalalanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_9, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4539, position: 1, content: "Zola kwa Se dieto, Nzambi,\nLutanga kwakonsono,\nFiduswa va ntoto eto;\nNkenda zandi kembisa.\nYesu, Ngeye wena zola,\nKwakunene ye nave,\nKundanga mu beto bantu,\nKoteti mu ntim’ami.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4540, position: 2, content: "Vumunina Mpeve kwaku\nNtima mio miavinzuka;\nYe difwa, do, utuvana,\nMvundulu yasilwa yo;\nVunza zola kwa masumu;\nAlafa ye Omega,\nNsukulu a minu kieto,\nVana ntima ntanunu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4541, position: 3, content: "Wiza, Yave, tanina ye\nVana moyo mvu ya mvu,\nVutuketi nswalu beni\nKutusisa diaka ko!\nNge’ tuzola vo wakunda\nNitu zeto mu nlongo;\nSambila ye toma sika,\nNge’ mu zola kwaku ko.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4542, position: 4, content: "Nsemono yampa yavewa\nLungisa yo mu mono,\nBika ngina toma songa\nZola kwaku kwa banka’;\nTuka nkembo kuna nkembo\nNunguswanga mu mamo.\nYe mu zulu ngina vana\nKoloa kiami kwa Yesu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_10, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4543, position: 1, content: "Nzambi i Mfumu anza yayo,\nZeyi mabanza mamansono\nMuntu kalendi kumvioka ko,\nLutidi babo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4544, content: "Tonda Mvulusi,\nTonda Mvulusi,\nNzeyi vo Ngeye i Mvulusi,\nTonda Mvulusi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4545, position: 2, content: "Ntangu mu kwiza kwa Mvulusi,\nYandi i Ntanini ababo;\nMenga katengula vana nti,\nLuiza vuluswa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4546, position: 3, content: "Bika tuakwikama mu mamo,\nMfingulu, nsevolo, nkwamusu,\nMfumu watuama mu yamuswa,\nYandi landanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4547, position: 4, content: "Mu kika yesu tuakubama,\nBu kana vutuka vava nza,\nLanda bavingila ngizulu,\nFundisa bambi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_11, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4548, position: 1, content: "Yavana moyo ami,\nYatengula menga va nti\nMu futa nkanu miaku\nYe mu kuvulusa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4549, content: "Biabionsono yayekula,\nI nki uvutula?", hymnsNumber: FtHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4550, position: 2, content: "Yasisa nsi yazulu\nYe kiandu kianzitusu mpe\nMu kala Nkundi aku\nYe tambula yambi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4551, position: 3, content: "Yavwikwa mpu yansende,\nYatiakwa mu mambu mambi,\nYavwezwa ye yabufwa,\nYakomwa vana nti.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4552, position: 4, content: "Mu ntumumunu ami\nYe mfwilu yampasi va nti\nUlenda fonguswanga\nYe baka mpulusu", hymnsNumber: FtHymnsNumberSeeder.GENERAL_12, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4553, position: 1, content: "Klisto meni fuluka,\nHaleluya!\nBantu ye zimbasi ta!\nHaleluya!\nYangalala lumbu ki,\nHaleluya!\nNza ye zulu, yimbila, Haleluya!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4554, position: 2, content: "Wena moyo lumbu ki;\nHaleluya!\nU lufwa, kwe ndungunu?\nHaleluya!\nYe ba kiaku kiena kwe?\nHaleluya!\nWafwa, meni fuluka.\nHaleluya!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4555, position: 3, content: "Nkudulu kalungisa; Haleluya!\nNtantu meni beduswa,\nHaleluya!\nNdiamu ka yansimba ko.\nHaleluya!\nZulu mpe kazibula.\nHaleluya!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4556, position: 4, content: "Ku kayenda, beto mpe,\nHaleluya!\nTuna landa Ntu nade,\nHaleluya!\nBonso Yandi, fuluka,\nHaleluya!\nBeto tuna kala mpe. Haleluya!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_13, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4557, position: 1, content: "Nsambi zau zawola\nBeti sikanga.\nMielo miena mwasi\nNtinu, kotele.\nKlisto si kayala,\nNkembo tambula!\nBalukidi kwandi,\nNeti ndungunu!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4558, content: "Salu kio kimeni\nYe tuyimbila!\nYesu balukidi\nYe ukemboso.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4559, position: 2, content: "Bu kafwila beto,\nWatuvulusa;\nBwabu weti vwanda,\nVwandanga ye Se.\nNdungulu zimeni,\nMpasi ye lufwa.\nNtinu wo wankembo\nMeni baluka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4560, position: 3, content: "Weti dila mvutu\nBaú balombanga;\nWeti kubavana\nNlemvo andi wo.\nFulu biau ku zulu\nWeti kubika;\nYesu wena mo", hymnsNumber: FtHymnsNumberSeeder.GENERAL_14, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4561, position: 1, content: "Vana dikulunsi\nYesu wavondwa,\nMboki bandiamisa,\nBandidila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4562, content: "Muna ndiamu kasa\nFuluka mu ngolo za Dise\nFuluka ye baluka\nMu nzitusu.\nKasa tambula\nKimfumu kia Dise.\nFuluka… fuluka!...\nAleluya, fuluya!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4563, position: 2, content: "Yandi wakengwa mpe\nVana mu ndiamu,\nKansi bakenga yo\nBatinuswa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4564, position: 3, content: "Bantu bazaya vo:\nYesu wafwidi,\nNzambi wamfidisa\nLuvulusu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4565, position: 4, content: "Lufwa lualembana\nBodisa Yesu\nLufwa luabeduswa;\nWafuluka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_15, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4566, position: 1, content: "Mpeve Yanlongo, Nsandisi\nFiduswa kwa Mvulusi,\nMoko meto simbanga,\nTu banzenza mwamu nza,\nVo ukututuasanga\nTuna yangalalanga.\nUtusungika mu nza\nYe ku zulu luakisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4567, position: 2, content: "Bonso nkundi finama\nLenda kwaku sadisa.\nNsisi zingi zeninga,\nTombe kingi mwamu nza.\nVuka vo kikwiza bwa\nNtima beba vuvu fwa.\nUtusungika mu nza\nYe ku zulu luakisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4568, position: 3, content: "Salu tuna manisa,\nNsendo tuna vingila;\nKwa mase tuayonzama,\nVo kwa Mfumu zamunwa;\n‘Te ye kuna nsukulu\nKuna kutusisa ko;\nUtusungika mu nza\nYe ku zulu luakisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_16, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4569, position: 1, content: "Nata zina dia yesu\nMwan’akiadi ye nzungu,\nDiau dilenda kwandi vana\nYenge ye luvovomo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4570, content: "Zina dio dienina\nVuvu Kwa babo mu nza;\nZina dio dienina\nKiese kia dizulu mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4571, position: 2, content: "Nata zina dia yesu\nBonso nkaku vwata dio.\nVo zinsindusulu zena\nLomba muna diau kwa Se.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4572, position: 3, content: "Nata zina dia yesu,\nBu lusambilanga Se,\nBuna wonga ye zinsisi\nKa billendi zinga ko.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4573, position: 4, content: "Buna nzila bu yimeni\nKuna zulu bwanana,\nTuna fukama ye sika\nYesu ye dizina dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_17, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4574, position: 1, content: "Tuenda tadi kulunsi\nDiatufwila Yesu,\nVana vena Mvulusi;\nBeto katu fwila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4575, content: "Kulunsi, kulunsi,\nDiatufwila Yesu,\nVana diau tulenda sa\nNkanu miena yeto.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4576, position: 2, content: "Vana va kakwamuswa,\nBu kakutufwila,\nZola kweti monika\nKuna kwa Kinzambi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4577, position: 3, content: "Kansi lenda bungwa? Ve\nKadi Tata diandi\nDiakumfulukisa mpe\nLumbu kio kiantatu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4578, position: 4, content: "Vana va dikulunsi\nWasa fotikisa\nNtu a Satana nade\nYe wanziona ngolo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_18, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4579, position: 1, content: "Bwe, luveduswa mu menga\nmandi mo\nMakatengula va Kulunsi?\nWeti sanga vuvu mpe mu\nMvulusi\nBu waveduswa mu menga mo?", hymnsNumber: FtHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4580, content: "Menga mo! Menga mo!\nWiza sukula mu menga mo,\nVula mvwatu miaku mio\nmiasumunwa,\nWiza veduswa mu menga mo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4581, position: 2, content: "Weti diatanga ye waku Mvulusi,\nBu waveduswa mu menga mo?\nWeti vunda kaka mu\nwakomunwa,\nBu waveduswa mu menga mo?", hymnsNumber: FtHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4582, position: 3, content: "Toko bu dikuiza si wakubama,\nBu waveduswa mu menga mo?\nMwela si uvwikulwa lunungu\nmpe,\nBu wavedswa mu menga mo?", hymnsNumber: FtHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4583, position: 4, content: "Vula mvwatu miaku bu\nmiasumunwa,\nWiza veduswa mu menga mo.\nNto yamenga kumbanga mu\nvedisa,\nYayi nto, wiza sukulwa yo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_19, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4584, position: 1, content: "Bwe isukula ntim’ami?\nMenga ma Yesu kaka.\nBwe ivuka mu yela ko?\nMenga ma Yesu kaka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4585, content: "Zinzungu beni\nZamana vedisa\nMintima Miandombe.\nMenga ma Yesu kaka", hymnsNumber: FtHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4586, position: 2, content: "Ka tulendi sukula ko\n(Mengama Yesu kaka)\nSumu dimosi nkutu ko;\nMenga ma Yesu kaka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4587, position: 3, content: "Vendisanga ntim´ami\nMenga ma Yesu kaka.\nBikilanga mbi ami,\nMenga ma Yesu kaka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4588, position: 4, content: "Nlemvo andi wawonso\nMenga ma Yesu kaka.\nMambu masonga mamonso\nMenga ma Yesu kaka.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_20, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4589, position: 1, content: "Luiza kua Yesu, lusampuka,\nYambula tina! Lukubama.\nNanguka, siseno fu biambi,\nBilenda kubungisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4590, content: "Muntu, muntu, O, nadimbeti;\nBwabu ntub’anlemvo yizidi,\nTanbula Yesu, Nlemvo a Dise\nUlenda kuvukisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4591, position: 2, content: "Yambula wila nduenga zambi,\nTina masiongi mankwa wambi,\nLanda Klisto nzila yayo;\nLuenga ye kubana.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4592, position: 3, content: "Lumbu biabieto biakufama\nYe tuna vioka ndimb’alufwa;\nNdolo kwa Yesu tuatambula\nMoyo wamvu ya mvu", hymnsNumber: FtHymnsNumberSeeder.GENERAL_21, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4593, position: 1, content: "Mpasi ye zinzungu weti\nYamusw’e?\nTadidila Yesu Klisto, Nsadisi.\nBanzilanga nkenda zandi mu\nmamo\nZena kiese beni bu zitangwanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4594, content: "Tanga nkenda, tangulula zo,\nTanga nkenda zeti sampanga,\nTanga zaku ziwatambudi,\nNgitukulu beni si wamwena zo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4595, position: 2, content: "Banzilanga nsinsi zikabedisa\nZitu ye mayindu bikanatina,\nMambu mandi mu mamo\nmabombanga,\nTanganga zinkumbu zikasidisa", hymnsNumber: FtHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4596, position: 3, content: "Bu utala bantu ye bimvwama biau,\nBanzila zinkenda zikasilanga,\nTanga zo zi ka zilendi sumbwa ko\nYe minsendo miaku ku\nkayengele.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4597, position: 4, content: "Tata mu dizulu weti vananga,\nBiobio bikazeyi bina tomisa,\nSila ndwenga zandi vuvu mu\nmamo\nTuendi tanga nkenda zandi\nmvu ka mvu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_22, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4598, position: 1, content: "Yesu wena Nkundi eto,\nWatutana mambi.\nBeto mpe tulenda nata\nNzungu zeto kwa Dise.\nBu tukondolo mayangi,\nVo mu mpasi tuenina,\nMu lusambulu tunata,\nBionso kwandi kwa Dise.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4599, position: 2, content: "Vo zimpukumunu zena,\nNzomono kwakonsono?\nLembwa beba ye zo nata\nMu lusambulu kwa Se.\nKwe ulenda sola nkundi\nUna nata biadi mpe?\nYesu zeyi mpasi zeto,\nKamba zo kwa Nzambi, Se.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4600, position: 3, content: "Kindakana kwena yeto,\nVo mayindu mena mpe?\nMvulusi ukidi yeto,\nSambidila bio kwa Se.\nVo bakundi  bakusisa,\nKamba dio kwa Mvulusi,\nMuna moko mandi mwena\nMbombolo ye ntanunu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_23, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4601, position: 1, content: "Mu Yesu nsidi vuvu kio,\nMu menga ye lunungu mpe\nKilendi tula minu ko\nMu kionso kiena vava nza.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4602, position: 2, content: "O! Vana tadi siamanga\nKa vena nienge nkutu ko,\nO! Yesu i ditadi dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4603, position: 3, content: "Vo tombe kieti swekanga,\nKiazolwa kiami, Mvulusi,\nIyekikanga ntu ami\nMu nlemvo andi wawonso.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4604, position: 4, content: "Vo vuka bieti yamisa,\nKwa Yesu ngieti singama,\nMu nsilulu zakedika\nIvunda ye isiamuswa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_24, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4605, position: 1, content: "Tutelama kwa Yesu,\nKakuba beno ko.\nMasumu mena yeno\nLutambudila mo.\nLwiza kweno bwabu,\nBabokilanga kwandi.\nMasumu ma luvanga,\nKakatukanga mo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4606, position: 2, content: "Lutelama kwa Yesu,\nLu bantu vava nsi.\nLuyambula masumu,\nLutineno mambi.\nYe mu zingolo zandi\nMambi lulenda sisa,\nYe keba mambu mandi\nYe landanga mo mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4607, position: 3, content: "Lutelama kwa Yesu,\nLunama nding’andi.\nLunsadisa mu kamba\nBabonsono mu nsi,\nBawilu mambu mandi,\nBalekila mo minu,\nLuwangudila bau\nMu nzila songele.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4608, position: 4, content: "Lutelama kwa Yesu,\nI Nsadisi eno.\nLuvunda vena Yandi,\nKasisa beno ko.\nLuvwata mambu mandi\nMakedika, mayenge,\nI buna si luakota\nKimfumu kia Dise.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4609, position: 5, content: "Tutelama kwa Yesu,\nTuyimbilanga mpe.\nVo kiadi evo kiese\nTuakwenda kwa Dise.\nU Nzambi utukeba\nYe utusakumuna\nYe utuvana Mpeve\nYikutubombanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_25, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4610, position: 1, content: "Nu kiamfulukulu Yesu\nMonekene vava nsi,\nKwa basolwa bandi, Mfumu\nFulukidi mu bafwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4611, content: "O! Tuayangalala kweto,\nMuna nkundulu andi\nYesu Mfumu a babonso\nFulukidi mu bafwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4612, position: 2, content: "Mfumu wena muna nkembo,\nMeni bedisa lufwa;\nMpulusu yayo yalunga,\nFulukidi mu bafwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4613, position: 3, content: "Si kakwiza diaka nswalu,\nMu matuti, monika;\nSi katela bantu mbila,\nBena moyo ye bafwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4614, position: 4, content: "Tuna monanga mayangi\nMuna ntima mieto mpe,\nKadi tuna kala Yandi\nMuna lumbu ´bionsono.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_26, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4615, position: 1, content: "Yenge kiena kuna zulu\nKu vata dia S´ eto;\nYe mayangi mena yau\nBa tudidi ko.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4616, content: "Buna bena bana mona\nYe Yesu ye Nzambi\nBana kala va mosi\nYe kundasana.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4617, position: 2, content: "Ye bindende biena kuna\nYe mbasi za Nzambi,\nBana kala ye bankaka\nYe vumina mo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4618, position: 3, content: "Buna bana toma visa\nMavanga ma Nzambi\nSi balenda toma zola\nYe yangalala.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4619, position: 4, content: "Kuna tombe kina lembwa\nYe bana ba Nzambi\nBonso ntangu bana sema\nVa kayengele.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_27, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4620, position: 1, content: "Kwa Nzambi finama,\nIfinama.\nVo i kulunsi mpe\nDiamfidila.\nNkunga iyimbila;", hymnsNumber: FtHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4621, content: "Kwa Nzambi finama,\nIfinama", hymnsNumber: FtHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4622, position: 2, content: "Vo bonso Yakobi\nMu fuku dio,\nTombe kianzungidi\nKia kani ko,\nNdozi yambulula:", hymnsNumber: FtHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4623, position: 3, content: "Nzil´ami yambula\nSonga kwa Se,\nYonso umfidisi\nI nlemvo mpe,\nMpofi zambokila:", hymnsNumber: FtHymnsNumberSeeder.GENERAL_28, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4624, position: 1, content: "Tukembelela Nzambi\nKu zulu evwandanga,\nO Mfumu eto ampwena,\nMwawonso eyalanga;\nKavang’e nsi ye zulu\nNkwa ngolo, Nkwa zitu mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4625, content: "Tukembelela Nzambi,\nWau katuzolele.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4626, position: 2, content: "Tukembelela Nzambi\nOkutuzolanga,\nKayika yeto an’andi,\nOkutubanzanga;\nKatuma Yesu Klisto,\nKafwa mu kuma kieto.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4627, position: 3, content: "Tukembelela Nzambi,\nMambote evanganga;\nNkwa ntim’avelela mpe;\nKazola mambi ko;\nE ntima mieto miambi,\nI Yandi osukula mio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4628, position: 4, content: "Tukembelela Nzambi,\nTunzolang’aka mpe.\nI muna nzil’azulu,\nTuzol’a kwendela.\nE Nzambi! Tata! Nkundi!\nKu zulu utunata.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_29, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4629, position: 1, content: "Nkundi eto, Yesu Klisto,\nUtuzolele babo,\nYe mu kiadi ye mu mpasi\nKana kutusisa ko.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4630, content: ":Yimbila, Yimbila!:\nMu nzil’eto ku dizulu\nKana kutusisa ko.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4631, position: 2, content: "Ye vo beto tuna kala\nNtangu yingi vava nza\nEvo katuka mu nsswalu\nKana kutukebanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4632, position: 3, content: "Vo mintantu mina kwiza,\nMina kutuyamisa,\nTuna lembwa kubatina;\nKana kututabila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_30, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4633, position: 1, content: "Fwanga ye Yesu mu minu va nti\nKundaga Yandi mu moyo wampa,\ntalanga Yesu mu ntangu zazo,\nMono i waku mu lumbu biabio", hymnsNumber: FtHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4634, content: "Lumbu ka lumbu unkeba nade,\nLumbu ka lumbu unsiamisanga,\nTalanga Yesu mu ntangu zazo,\nMono i waku mu lumbu biabio", hymnsNumber: FtHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4635, position: 2, content: "Vo mpasi zena, kansisanga ko\nVo zitu biena, unatanga bio,\nVo kiadi kiena, ubombanga mpe,\nLumbu ka lumbu unkeba nade.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4636, position: 3, content: "Vo tueti dila ye sambanga mpe\nBika kanatya mayindu mamo,\nKuna dizulu i beto babo,\nLumbu ka lumbu kabanzilanga", hymnsNumber: FtHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4637, position: 4, content: "Vo kindakana, uzeyi kwako\nVo tuena yela, uniakisanga.\nLumbu ka lumbu, mu wonga wawo,\nWena ye beto, kasisanga ko.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_31, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4638, position: 1, content: "Yesu Mvulusi umvwidi\nVa dikulunsi kafwa\nMu kunkula mu kinanga\nYe minswa mia Satana.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4639, content: "Ikuzola, Mfumu Yesu,\nKina sisa Ngeye ko,\nMvwilu aku ngiena bwabu,\nMvwilu aku mvu ya mvu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4640, position: 2, content: "Yesu Mvulusi umwidi,\nKikivwidi nkutu ko.\nNtim’ami kwa Yesu mpeni,\nYAndi weti yala wo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4641, position: 3, content: "Yesu Mvulusi umvwidi,\nE, mayangi! Nzeyi vo\nMfumu Yesu, Nkudi ami,\nWena Ntinu mvu ya mvu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_32, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4642, position: 1, content: "Untuadisanga mu mamo,\nI mambu mena mbombolo;\nMu kionso kiivanganga,\nMu koko kwandi tuadisa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4643, content: "Untuadisanga mu mamo,\nMu koko kwandi, tuadisa;\nMu nama Yesu, nzolele,\nUntuadisanga mu mamo", hymnsNumber: FtHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4644, position: 2, content: "Bu ngieti mona ntontolo,\nBu ngieti mona kiese mpe,\nI mambu mo iyimbila:\n“Untuadisanga mu mamo”.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4645, position: 3, content: "O, Mfumu, mbeni yekulwa,\nMu kala waku mvu ya mvu;\nBu ngieti tuaduswa kwa Nge’,\nIyangalala mu mamo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4646, position: 4, content: "Mu mbanunu a moyo wau,\nBu tuna baka ndungunu,\nLufwa ka tuna tina ko;\nUntuadisanga mu mamo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_33, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4647, position: 1, content: "Wonso, wonso wilu, tendikisa wo,\nNsamu wo wabiza mu nsi yayonsono;\nMwanginisa nsangu kwa babonsono\nWonso wonso bika kiza", hymnsNumber: FtHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4648, content: "Wonso wonso kaka,\nWonso wonso kwandi,\nKamba bantu muna nsi zazonsono.\nWonso una mpwila, wonso una nsatu;\nWonso wonso bika kiza", hymnsNumber: FtHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4649, position: 2, content: "Wonso una kwiza, kavunzi lumbu ko;\nVitu mpe diaziuka, kota dio wunu,\nYesu Yandi i nzila yabiza kikilu;\nWonso wonso bika kiza.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4650, position: 3, content: "Wonso mweni mpasi vo tuzinunu,\nWonso kankamanga muna masumu;\nWonso weti tina fwa kwa mvu ya mvu;\nWonso wonso bika kiza.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4651, position: 4, content: "Wonso una zayi wa masumu,\nWonso una ntima wakimpumbulu;\nWonso una nsatu a luvulusu:\nWonso wonso bika kiza.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_34, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4652, position: 1, content: "Tanga mambu ma Bibila,\nMambu ma mvulusi;\nInga, tuna mo zolanga,\nMambu ma Nzambi, se.\nMatufwiti tanga,\nMena mbote kwandi:", hymnsNumber: FtHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4653, content: "Mambu mamo tanganga mo,\nMambu ma Mvulusi,\nMambu mamo tanganga mo,\nMambu ma Nzambi, Se.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4654, position: 2, content: "Yesu, vananga kwa babo,\nMambu ma Nzambi, Se;\nNkwa masumu, nadimbeti,\nMambu ma Mvulusi.\nWiza tambuleti,\nMena nkailu kwandi", hymnsNumber: FtHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4655, position: 3, content: "Samuna kwa babonsono,\nMambu ma Mvulusi;\nYenge, vananga kwa babo,\nMambu ma Nzambi, Se.\nMvulusi umosi,\nBiekanga mu mambu:", hymnsNumber: FtHymnsNumberSeeder.GENERAL_35, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4656, position: 1, content: "Yonzika bantu kwa Mvulusi\nKadi Mfumu watele bo.\nBayela, bamputu ye bababi,\nNsamu wizidi kwa babo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4657, content: "Muna mavata, muna zimpambu\nMuna zinzila zambi\nTuendano, tuenda tuakambeno:\nLuiza kwa Mvulusi!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4658, position: 2, content: "Bantu balembolo vuluswa,\nMu masumu bazimbale,\nMu moko mambungi bakangama,\nBena nsatu aluenguswa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4659, position: 3, content: "Nani ye nani uzolele\nKubatuadila nsamu wau,\nVo Nzambi, i Mfumu, uzolele\nBana bandi bazimbale?", hymnsNumber: FtHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4660, position: 4, content: "Kamba mu zola, vo Nzambi au\nWeti zola ye vingila,\nYe vo mu dizulu mwatotulwa\nNzo yabiza mu diambu diau.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_36, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4661, position: 1, content: "Nlemvo unene wa Mvulusi,\nMami mambi uviokele mo,\nVana va mongo wa kulunsi,\nMenga ma Yesu matengulwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4662, content: "Nlemvo, nlemvo\nNlemvo ulenda kusukula;\nNlemvo, nlemvo,\nNlemvo ubedisanga mambi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4663, position: 2, content: "Satana zolanga bungisa,\nMiela miamio ye mioyo mieto;\nNlemvo unene wa Mvulusi,\nSonganga nzila ya kulunsi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4664, position: 3, content: "Tona dilembane swekama,\nI nki kilenda sukula dio?\nTala kwa nlemvo wa Mvulusi,\nUlenda katula tona dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4665, position: 4, content: "Nlemvo unene wa Mvulusi,\nLekele minu tambudi wo;\nWonso utidi kummona mpe,\nUfwiti tambula nlemvo wo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_37, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4666, position: 1, content: "Mfumu, Nge’ i Mvulusi,\nNgeye wena mwind’anza;\nNgeye kaka Ntanini,\nUtukeba vava nsi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4667, position: 2, content: "Yesu, Nge’ watombuka,\nMu kimfumu mvu ya mvu,\nNge’ i Mfumu a babo\nUtunata beto mpe.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4668, position: 3, content: "Yesu una vutuka,\nTuna yangalalanga,\nBwabu tueti sambila,\nMfumu, utubanzila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4669, position: 4, content: "Haleluya, zitisa\nNkumbu yo yilutidi,\nTata, Mwana, Mpeve mpe\nBwabu utubanzila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_38, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4670, position: 1, content: "O Mfumu i ditadi dio\nI nluka utuswamanga.\nKa tuena wonga nkutu ko\nMu nluka utuswamanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4671, content: "O! Yesu i ditadi\nMu nza yayo,\nMu nza yayo\nMu nza yayo\nI Ntinunu kwa bandi\nMu nsi zazo.\nI nluka utuswamanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4672, position: 2, content: "I mpongoso mu mwini wo\nI nluka utuswamanga.\nLusadusu mu fuku mpe,\nI nluka utuswamanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4673, position: 3, content: "Vo vuka kiena ngolo mpe,\nMu nluka tueti swamina.\nMu tadi tueti sikila\nI nluka utuswamanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4674, position: 4, content: "Dianlongo ye diantalu mpe,\nI Tadi dituswamanga.\nDo, fikama ye sadisa,\nO, Tadi dituswamanga.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_39, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4675, position: 1, content: "Meme dia Nzambi diena vava nsi;\nTala kwa Meme dio.\nYandi wakula ngeye vana nti;\nTala kwa Meme dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4676, content: "Tala kwa Meme dio!\nTala kwa Meme dio!\nMu Yandi kaka mpulusu yena.\nTala kwa Meme dio!", hymnsNumber: FtHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4677, position: 2, content: "Kondwa kwaminu,\nmpukumunu mpe\nTina zingolo zaku zazike,\nTala kwa Meme dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4678, position: 3, content: "Weka um beb’e nzila yayi’e?\nTala kwa Meme dio.\nBenzi vo Yandi ukuyekul’e?\nTala kwa Meme dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4679, position: 4, content: "Mpasi zazingi zizidi nasiu;\nTala kwa Meme dio.\nKiadi vo kiese, Mfumu zeyi mo;\nTala kwa Meme dio.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_40, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4680, position: 1, content: "Tuendano kweto kwa Yesu babo,\nKidi tuankamba masumu mamo.\nYandi i nkundi a bantu babo,\nKadi kazolele babonsono.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4681, content: "Nlemvo kasila bantu babo,\nBantu babo, bantu babo;\nYandi kasila bantu babo\nNlemvo wakedika.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4682, position: 2, content: "Yesu uzolanga beto babo,\nKadi mu nkanda tutanganga bo;\nWenina yeto mu nlemvo wawo,\nBu tuena moyo ye bu tuna fwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4683, position: 3, content: "Yandi ubokanga: “Luiza babo,\nMpasi luamona mayangi nade.\nMinu lusanga mu mampovele,\nMono isadisa beno babo”", hymnsNumber: FtHymnsNumberSeeder.GENERAL_41, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4684, position: 1, content: "Mu Nzitu kavwandanga\nVa kiandu kia Dise;\nWavwata Mpu wankembo mpe\nMu nlemvo weti ta,\nMu nlemvo weti ta.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4685, position: 2, content: "Ka mwena muntu nkutu ko\nMu ntoto wau wawo\nUviokele mu ntoko zo\nZa Yesu, Mvulusi,\nZa Yesu, Mvulusi.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4686, position: 3, content: "Wansadisa mu nzungu zo\nZabunga mwel’ami,\nWayekulwa mu nsingulu,\nMu kula moyo wau,\nMu kula moyo wau.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4687, position: 4, content: "Zinsatu za banlongo mpe\nKayukutisanga.\nBanunguswanga vava nza;\nWabedisa lufwa,\nWabedisa lufwa.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_42, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4688, position: 1, content: "Ukututuadisanga,\nO Ntinu, mvu ya mvu\nMu lumbu biabi kwandi\nBitueti salanga.\nMu nkubumunu eto\nTuasiamuswa mu Nge’\nYe bwabu tueka kwenda\nMu samuna mamo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4689, position: 2, content: "Ukututuadisanga,\nO Ntinu, mvu ya mvu,\nMu kubakienzudila\nMu tombe benina.\nTuzolele kunama\nYe longa Mambu mo\nMasonganga vo Yesu\nI Nzila, kedika.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4690, position: 3, content: "Ukututuadisanga,\nO Ntinu, mvu ya mvu\nYe konso una kwenda,\nTunamanga kwako;\nYe kiese tueti mona\nMu landa kia ko\nYe zaya vo minsendo\nMikutuvingila.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_43, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4691, position: 1, content: "Mpeve yavedila,\nTuwilu vo Ngeye\nWafiduswa kwa Nzambi, Se,\nMu zitisa Yesu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4692, position: 2, content: "Mpeve Yavedila\nTuwilu diadi mpe,\n“Wonso una kutambula\nKazitisa Yesu”.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4693, position: 3, content: "Mpeve Yavedila,\nO! Nsatu ngienina\nVo ngina vuwa kwa Ngeye\nYe zitisa Yesu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4694, position: 4, content: "Mpeve Yavedila,\nNtomene yekula\nNtim’ami ye biabionsono\nKwa Ngeye mvu ya mvu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4695, position: 5, content: "Mpeve Yavedila,\nO! Bwabu nzeyi vo\nUmeni kota ntim’ami,\nYe Yesu zitusu.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_44, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 4696, position: 1, content: "Va zinsilulu za Klisto telama.\nMvu mi ka mimani sika nkumbu yo.\nNzitusu kwa Mfumu si yayimbila,\nTelama nsilulu va nsilulu zazo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4697, content: "Siama! Siama!\nTelama va nsilulu za Mvulusi\nO! Siama! Siama!\nVa nsilulu za Nzambi telama.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 4698, position: 2, content: "Telama va nsilulu zisiamuswa,\nVuka biangolo bu bikwizanga\nMuna Mambu mandi mwena ndungunu\nTelama va nsilulu zazo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4699, position: 3, content: "Va nsilulu zamoyo telama\nBundana ye Yandi vizolanga\nSabala kia Mpeve kina nungisa,\nTelama va nsilulu zazo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 4700, position: 4, content: "Um zinsilulu zamoyo telama\nDimba nding’a Mpeve andi mu mamo\nVunda kaka muna Mvulusi ami\nTelama va nsilulu zazo.", hymnsNumber: FtHymnsNumberSeeder.GENERAL_45, typeStanza: HymnsContentCode.VERSE),
  ];
}